import AppLayout from "../components/AppLayout";
import Head from "next/head";
const Home = () => {
  return (
    <>
      <Head>
        <meta charSet="utf-8" />
        <title>NodeBird</title>
      </Head>
      <AppLayout>
        <div>Hello index</div>
      </AppLayout>
    </>
  );
};

export default Home;
